	function displayBullet($content){
		$wBreak = nl2br(e($content));
		$bulletArrs = explode("\n", $wBreak);
		echo "<ul>";
			foreach($bulletArrs as $bulletArr){
				echo "<li>$bulletArr</li>";
			}
		echo "</ul>";
	}
@endphp

@php

	function displayTable($head, $body) {
		$hBreak = nl2br(e($head));
		$headArrs = explode("\n", $hBreak);

		$bBreak = nl2br(e($body));
		$bodyArrs = explode("\n", $bBreak);

		$num1 = 0;
		$num2 = 0;

		echo "<table class='zui-table zui-table-zebra zui-table-horizontal' style='text-align:center;'><thead><tr>";
		foreach($headArrs as $headArr) {
			if(substr($headArr, 0, 4) == "null"){
				echo "<th style='text-align:center !important;'></th>";
			}
			else {
				echo "<th style='text-align:center !important;'>$headArr</th>";
			}
			
			$num1++;
		}
		echo "</tr></thead><tbody><tr>";
		foreach($bodyArrs as $bodyArr) {
			$num2++;
			if($num2 == "1" || $num2 == "5" || $num2 == "9" || $num2 == "13" || $num2 == "17"){
				echo "<td style='text-align: left !important;'>$bodyArr</td>";
			}
			else{
				echo "<td>$bodyArr</td>";
			}
			
			
			if($num1 == $num2) {
				echo "</tr><tr>";
				$num2 = 0;
			}
		}
		echo "</tr></tbody></table>";
	}

	function displayNumber($value) {
		$vBreak = nl2br(e($value));
		$valueArrs = explode("\n", $vBreak);
		$num = 1;
		foreach($valueArrs as $valueArr) {
			echo "$num. $valueArr<br>";
			$num++;
		}
	}

	function displayDef($word, $def) {
		$wBreak = nl2br(e($word));
		$wordArrs = explode("\n", $wBreak);

		$dBreak = nl2br(e($def));
		$defArrs = explode("\n", $dBreak);

		$count = count($wordArrs);

		echo "<table border='0'>";
		for($num = 0; $num<$count; $num++) {
			echo "<tr><td><b>$wordArrs[$num]</b></td><td>&nbsp;&nbsp;&nbsp; -&nbsp; $defArrs[$num]</td></tr>";
		}
		echo "</table>";
	}

